import React from "react";
import {Link} from 'react-router-dom'
const DisplayHomeData = (props) => {
    let dataUrl ='/'+props.reqParams + '/'; 
    
  return (
    <div className="row ">
      {props.allData.length &&
        props.allData.map((data) => (
          <div key={data.id} className="">
            <div className="card text-center">
              <img src={data.image} className="card-img-top" alt="..." />
              <div className="card-body">
                <Link to={dataUrl + data.id} className="card-title">
                  {data.name ? data.name : data.title}
                </Link>
               
              </div>
            </div>
          </div>
        ))}
        <Link to={"/" + props.reqParams} className="btn btn-get-started"> More</Link>
    </div>
  );
};
export default  DisplayHomeData;
